(18, 'Udhetimi ne Cythera', ' Luksi dhe atmosfera romantike ne pikture, te paraqitura permes njerezve se bashku, me kostume te bukura dhe elegante, jane nje karakteristike  e zakonishme e pikturave rokoko.', 4, , 'Jean Antoine Watteau - Em');
INSERT INTO `pikturat_umpla` (`ID_piktura_umpla`, `piktura_umpla`, `tipari_piktures_umpla`, `ID_levizja_artistike_umpla`, `foto`, `emri`) VALUES
(20, 'Rastesite e lumtura te luhateses', 'Ne foto paraqitet nje grua e re ne nje luhatese. E tere hapesira ne foto, natyra, ngjyrat e perdorura, gruaja me rrobat dhe floket e saj te shprishura lehtesisht gjate luhatjes, krijojne nje ndjesi te levizjes dhe lirise.', 4, , 'cropped-1.jpg');
INSERT INTO `pikturat_umpla` (`ID_piktura_umpla`, `piktura_umpla`, `tipari_piktures_umpla`, `ID_levizja_artistike_umpla`, `foto`, `emri`) VALUES
(24, 'Shenja e Gersaint', 'Piktura me komplekse tregon nje dyqan arti. Kemi te bejme me dashurine e shoqerise pariziane, per pikturat dhe skultpturat e ndryshme, ku disa nga to shfaqen si detaje ne kete pikture.', 4, , 'l-enseigne-de-gersaint-17');
INSERT INTO `pikturat_umpla` (`ID_piktura_umpla`, `piktura_umpla`, `tipari_piktures_umpla`, `ID_levizja_artistike_umpla`, `foto`, `emri`) VALUES
(25, 'Stuhi ne Detin e Galileas', 'Shfaqe nje mjeshteri artistike ne teknikat e ndricimit dhe erresires ne pikture, te cilat krijojne nje atmosfere dramatike dhe emocionale. Atmosfere kjo, qe percjell me kujdes ngjarjen biblike te nje fortune ne Detin e Galileas.', 5, , 'rembrandt.jpg');
INSERT INTO `pikturat_umpla` (`ID_piktura_umpla`, `piktura_umpla`, `tipari_piktures_umpla`, `ID_levizja_artistike_umpla`, `foto`, `emri`) VALUES
(27, 'Vajzat e vogla ', 'Skene ne nje dhome te pallatit spanjoll. Kjo pikture ka te beje me Margariten, vajzen ne qender, qe paraqet debatin e kesaj pikture. Piktori, icili ka pikturuar veten gjithashtu afer karaktereve kryesore, paraqet enigme ne lidhjet mes personazheve.', 5, , 'Las-Meninas--009.webp');
INSERT INTO `pikturat_umpla` (`ID_piktura_umpla`, `piktura_umpla`, `tipari_piktures_umpla`, `ID_levizja_artistike_umpla`, `foto`, `emri`) VALUES
(28, 'Shen Sesilia', 'E shenjta e muzikes. paraqitet ne paqe me anen e saj  muzikore ne nje ambient kishe. E kthyer nga qielli, se bashku me instrumentin e saj, si nje atribut te domosdoshem, ajo rikrijon legjenden se muzika eshte element kyc i frymezimit shpirteror.', 5, , 'Vouet,_Simon_-_Saint_Ceci');

